 a script. Spend time at the beginning of each session to discuss the participant’s situation and make sure the task scenario matches their exact circumstance. It’s OK to prepare some more generic tasks prior to the study, but be willing to modify or craft new ones on the spot as you learn more about the participant’s situation, and as the session unfolds. You want t', '', 'filtered_html');
