INSERT INTO `search_dataset` VALUES ('1', 'node', ' teet ed about a disease it s not good enough to recruit participants who generally fit the demographic profile such as by age gender income level and location such criteria are too broad to give you deep insight general recruitment criteria won t cut it you must find people who are actually in the process of researching the information you are evaluating be aware of the limitations of unmoderated studies unmoderated studies are done without the facilitator present participants work on their own this method can be useful for getting user feedback on narrow parts of the site such as workflow or snippets of information however when trying to discover how people conduct research compare offerings and make decisions the best approach is to conduct a moderated study where the facilitator is present content studies tend to have long stretches of time when the user is simply scanning page after page in silence when left alone such as in an online unmoderated situation users may feel awkward and wonder whether they re being helpful without proper feedback and reassurance participants often alter their behavior by approaching the task in a more superficial manner task times are often shorter for online studies than in traditional test settings when on their own participants assume that the goal is to work quickly not realistically also the facilitator can ask the user for clarifications with unmoderated studies you miss opportunities to ask personalized usertailored followup questions even though participants are instructed to think out loud they often forget to explain their actions and thoughts give tasks that are tailored for each individual in most traditional usability studies researchers follow a prepared script and give study participants prescripted tasks to perform for content testing minimize your reliance on a script spend time at the beginning of each session to discuss the participant s situation and make sure the task scenario matches their exact circumstance it s ok to prepare some more generic tasks prior to the study but be willing to modify or craft new ones on the spot as you learn more about the participant s situation and as the session unfolds you want t  ', '0');
